import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

function Frontrouter(){
    return(
        <BrowserRouter>
        <Route path="/" exact component={Beranda} />
        <Route path="/home" exact  component={Beranda} />
        </BrowserRouter>
    )
}

export default Frontrouter;
